def UTCDate = new java.text.SimpleDateFormat("yyyy-MM-dd")
//def UTCTime = new java.text.SimpleDateFormat("HH:mm:ss");
//UTCTime.format( new Date()) + 5*60*1000

def timeOffset = context.expand( '${Excel Source#TimeOffset}' )
//return timeOffset
Date dNow = new Date(System.currentTimeMillis()+((timeOffset.toInteger())*60*1000))
java.text.SimpleDateFormat UTCTime = new java.text.SimpleDateFormat ("HH:mm:ss");
//return(ft.format(dNow));

/*UTCTime + 5*60*1000
return UTCTime */
UTCDate.setTimeZone(TimeZone.getTimeZone('UTC'))
UTCTime.setTimeZone(TimeZone.getTimeZone('UTC'))
def res= (UTCDate.format( new Date())).toString()+'T'+(UTCTime.format(dNow)).toString()+'Z'
return res.toString()

