def token1 = context.expand( '${Generate Signature Token#Response#$.ResponseStatus}' )
def authUser = context.expand( '${Authenticate User#Response#$.ResponseStatus}' )
def token2 = context.expand( '${Generate Signature Token 2#Response#$.ResponseStatus}' )
def authApp = context.expand( '${Authenticate Application#Response#$.ResponseStatus}' )

if ((token1=="OK") && (authUser=="OK") && (token2=="OK") && (authApp=="OK"))
{
	def res = "Passed"
	return res.toString()
}
else
{
	def res="Failed"
	return res.toString()
}

